import React from 'react';
import { BrowserRouter as Router, Routes, Route, Link, useLocation } from 'react-router-dom';
import PredictRainfallPage from './pages/PredictRainfallPage';
import CountryTrendPage from './pages/CountryTrendPage';
import IndexPage from './pages/IndexPage';

const Navigation: React.FC = () => {
  const location = useLocation();

  return (
    <nav className="bg-white shadow-lg">
      <div className="max-w-7xl mx-auto px-4">
        <div className="flex justify-between h-16">
          <div className="flex">
            <div className="flex-shrink-0 flex items-center">
              <Link to="/" className="text-xl font-bold text-blue-600">
                Rainfall Analysis
              </Link>
            </div>
            <div className="hidden sm:ml-6 sm:flex sm:space-x-8">
              <Link
                to="/predict"
                className={`${
                  location.pathname === '/predict'
                    ? 'border-blue-500 text-blue-600'
                    : 'border-transparent text-gray-500 hover:border-blue-500 hover:text-blue-600'
                } inline-flex items-center px-1 pt-1 border-b-2 text-sm font-medium`}
              >
                Predict Rainfall
              </Link>
              <Link
                to="/country-trend"
                className={`${
                  location.pathname === '/country-trend'
                    ? 'border-blue-500 text-blue-600'
                    : 'border-transparent text-gray-500 hover:border-blue-500 hover:text-blue-600'
                } inline-flex items-center px-1 pt-1 border-b-2 text-sm font-medium`}
              >
                Country Trends
              </Link>
            </div>
          </div>
        </div>
      </div>
    </nav>
  );
};

const App: React.FC = () => {
  return (
    <Router>
      <div className="min-h-screen bg-gray-100">
        <Navigation />
        <main className="max-w-7xl mx-auto py-6 sm:px-6 lg:px-8">
          <Routes>
            <Route path="/" element={<IndexPage />} />
            <Route path="/predict" element={<PredictRainfallPage />} />
            <Route path="/country-trend" element={<CountryTrendPage />} />
          </Routes>
        </main>
      </div>
    </Router>
  );
};

export default App;
